// React
import React, { Fragment, useEffect, useState } from "react";

// Third Part
import { Layout } from "antd";

// Custom
import { HeaderTitle, CustomTable } from "../common";
// Services
import {
  getDishes,
  addDishes,
  deleteDishes
} from "../../services/dishServices";

const { Content } = Layout;

const [data, setData] = useState([]);

const CustomContent = () => {
  useEffect(() => getDishes().then(setData(data)));

  return (
    <Fragment>
      <Content style={{ margin: "2em 16px" }}>
        <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
          <HeaderTitle title={"Dish Menu"} />
          <CustomTable
            colOne={"name"}
            colTwo={"price"}
            colThird={"type"}
            colFourth={"date"}
            colFive={"Actions"}
          />
        </div>
      </Content>
    </Fragment>
  );
};

export default CustomContent;
